import React from 'react';

const Home = () => {
    return (          
        <div className="row">
            <h2>You Are Logged In</h2>
            <p><i className='fa fa-check-circle-o'></i></p>
            <a href="/" className="btn btn-primary btn-sm">Logout</a>
        
        </div> 
    );
}

export default Home;
